    "format": "8vo",
    "volumes": "1",
    "in_1908": true,
    "notes": "While the original catalogue records the publication date of this text as '1675', no known editions of this text were published in that year. The printing on this text's title page seems to explain the original catalogue's mistake of '1675' for the publication date. The title page gives the date not in Roman numerals, but in Greek numerals as ',αχϞε', where ',α' = 1000, 'χ' = 600, 'Ϟ' = 90, and 'ε' = 5. However, the Greek Koppa 'Ϟ' on the title page looks very close to a Greek Zeta 'ζ', which is the Greek numeral for 7. The original author of the catalogue likely mistook the Greek letter for a zeta, or a 7, and recorded the date as '1675'.",
    "ESTC": "R7966",
    "EEBO": "P1960"
