    "notes": "Charles Knight (1803-67), son of Edward Austen Knight, an amateur naturalist, mentions The Analogy in his diary in 1832: 'Sunday March 11. My birthday 29 years old. I ought to make better use of my time, & hope to spend this year more profitably than the preceding ... I should like to get up at six dress & read the Bible till 1/2 past 7, then sermonize for two hours every other day, on the alternate days read Butler's Analogy Sermon on the creed or some other doctrinal work. From ten till 1/2 past 11 Horace's satires or some other classic, alternate days some scripture history; till past one natural history. Before bed time read a sermon or some practical work of divinity. Any intermediate time reviews or some other modern light reading. Then the history of England & modern Geography in which I am sadly deficient ought to come in ... I read part of Barrow's sermon on the Gunpowder Treason.' (Note provided by Hazel Jones. Source: Jane Austen’s House Museum, CHWJA:JAH409.1; Diary marked number 2, January 22, 1832 – August 10, 1832)",
